import osfrom src.s_04.e_05 import DocumentRAGfrom src.send_task import send# Initialize the QA systemqa_system = DocumentRAG(    documents_path="/Users/Chabi/Desktop/ai_devs/ai_devs_solution/data/s04e05",    index_name="ai-devs-s04e05",    refresh=False,)questions = {    "01": "Do którego roku przeniósł się Rafał",    "02": "Kto wpadł na pomysł, aby Rafał przeniósł się w czasie?",    "03": "Gdzie znalazł schronienie Rafał? Nazwij krótko to miejsce",    "04": "Którego dnia Rafał ma spotkanie z Andrzejem? (format: YYYY-MM-DD)",    "05": "Gdzie się chce dostać Rafał po spotkaniu z Andrzejem?"}answer = {}# Query each question and store answersfor key, question in questions.items():    result = qa_system.query(question)    answer[key] = result["result"].strip()    print(f"\nQuestion {key}: {question}")    print(f"Answer {key}: {answer[key]}")print("\nFinal answer dictionary:")print(answer)# If you want to send the resultsres = send(    f"{os.environ.get('CENTRALA_URL')}report",    task="notes",    apikey=os.environ["API_KEY"],    answer=answer,)print("\nAPI Response:", res)